// Archivo que permite saber a las otras páginas que el usuario se ha logueado
import { createContext } from "react";

const context = createContext();

export function AuthProvider(children) {
  const user = {
    login: true
  }
  return
      <context.Provider value = {{user}}>
      {children}
    </context.Provider>
}
